  \"2016-02-22T20:43:04.299292\",\n\t\"name\": \"marine-resource-survey-in-waters-surrounding-guam-and-the-commonwealth-of-the-northern-mariana-\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"The goals of the cruise were to collect
  a variety of data to assess the status of marine resources in waters surrounding
  Guam and CNMI.  Marine resource habitats were mapped using a Reson 8101ER multiubeam
  sonar operating at 240 kHz frequency.  Seabed was characterized by still and video
  recordings using a SeaBED AUV and a Towed Optical Assessment Device (TOAD).  Biological
  backscatter were recorded using an EK60 echosounder system operating at 38, 70,
  & 120 kHz along predetermined transects.  Fish were sampled by Baited Remote Underwater
  Video Stations (BRUVS) and BotCam drops equipped with stereo cameras at predetermined
  locations.  During the survey, a High-frequency Acoustic Recording Package (HARP)
  was deployed at 15? 18.998'N 145?27.542'E.\",\n\t\"license_title\": null,\n\t\"extras\":
